import React from 'react';
import './App.css';
import AppMain from "./components/index";
import { BrowserRouter as Router} from 'react-router-dom';
import RoutesNav from './data/Routes';

function App() {
  return (
    <Router>
      <AppMain/>
      <RoutesNav/>
    </Router>
  );
}

export default App;
